import './App.css';
import { Container, Nav, Navbar, NavDropdown } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';

function App() {
  return (
    <>
      <style type="text/css">
      {`
        .game-title {
          color: orange;
          font-weight: 800;
          font-size: 35px;
        }

        .medicine-app 
          font-size: 20px;
        }
      `}
    </style>
    <Navbar>
      <Container>
        <Navbar.Brand href="#home" className="game-title">Duranki <div className="medicine-app">- Medinzinapp</div></Navbar.Brand>
        <Navbar.Toggle />
        <Navbar.Collapse className="justify-content-end">
          <Navbar.Text>
            Made by HOLA - Vr Trail Walking Group
          </Navbar.Text>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  </>
  );
}

export default App;
